import React, { useState } from "react";
import { Form, Input, Select, Button } from "antd";

import { API_URL } from '../utils/constants';

const { Option } = Select;

function FileUploadForm() {
  const [file, setFile] = useState(null);
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [model, setModel] = useState("");

  const handleFileChange = e => {
    setFile(e.target.files[0]);
  };

  const handleTitleChange = e => {
    setTitle(e.target.value);
  };

  const handleDescriptionChange = e => {
    setDescription(e.target.value);
  };

  const handleModelChange = value => {
    setModel(value);
  };

  const handleSubmit = e => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("file", file);
    formData.append("title", title);
    formData.append("description", description);
    formData.append("model", model);
    const headers = new Headers();
    headers.append("Content-Type", "multipart/form-data");
    fetch(`${API_URL}/uploadFile`, {
        method: "POST",
        body: formData,
        headers: headers
    })
    .then(response => response.json())
    .then(data => {
        console.log(data);
    })
    .catch(error => console.error(error));
};


  return (
    <Form onFinish={handleSubmit}>
        <Form.Item label="File">
          <input type="file" onChange={handleFileChange} />
        </Form.Item>
        <Form.Item label="Title">
          <Input onChange={handleTitleChange} value={title} />
        </Form.Item>
        <Form.Item label="Description">
          <Input onChange={handleDescriptionChange} value={description} />
        </Form.Item>
        <Form.Item label="Model">
          <Select
            defaultValue="test-01"
            onChange={handleModelChange}
            value={model}
          >
            <Option value="test-01">test-01</Option>
            <Option value="test-02">test-02</Option>
            <Option value="test-03">test-03</Option>
          </Select>
        </Form.Item>
        <Form.Item>
        <Button type="primary" htmlType="submit">Upload</Button>
        </Form.Item>
    </Form>
  );
}

export default FileUploadForm;
